import { User } from "../../types/usersTypes";


export const getSortedNameUsers = (users:User[]) => ({
    type: 'GET_ALL_USERS',
    users
  
})

export const getSortedDateUsers = (users: User[]) => ({
    type: 'SORT__USER',
    users
})

export type UsersAction = ReturnType<typeof getSortedNameUsers> | ReturnType<typeof getSortedDateUsers>;
